import React from 'react';

const LogbookSterilisasiRuangTungguInput = () => (
  <div className="min-h-screen bg-gray-50 py-8 px-2 sm:px-6 flex flex-col items-stretch">
    <div className="w-full max-w-2xl bg-white rounded-xl shadow-lg mx-auto p-6 sm:p-8">
      <h2 className="text-xl sm:text-2xl font-bold mb-6 text-blue-900 text-left">Logbook Sterilisasi Ruang Tunggu</h2>
      <div className="text-gray-400 text-center py-12">(Form dummy, belum tersedia)</div>
    </div>
  </div>
);

export default LogbookSterilisasiRuangTungguInput;
